const Header = (props) => {
  return (
    <div>
      <h1>{props.course}</h1>
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>
      Number of exercises {props.props1+props.props2+props.props3}</p>
    </div>
  )
}

const Part = (props) => {
  return (
    <div>
      <p>{props.name} {props.excercise}</p>
    </div>
  )
}

const Content  = (props) => {
  return (
    <div>
      <p>Part </p>
      <p>{props.name2} {props.number2}</p>
      <p>{props.name3} {props.number3}</p>
    </div>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header course={course} />
      <Content name={part1} number={exercises1} name2={part2} number2={exercises2} name3={part3} number3={exercises3}/>
      <Total props1={exercises1} props2={exercises2} props3={exercises3}/>
    </div>
  )
}

export default App
